  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this study was to inventory
  the breeding birds, both game and nongame, present within the boundaries of the
  Mark Twain NWR, and to identify habitat types being used. Breeding birds were inventoried
  using the point count method during the peak breeding season on the Delair Division
  of the Mark Twain National Wildlife Refuge, Annada District. No survey of breeding
  birds had yet been done, and these data were needed to guide management decisions
  for the future. Each of the nine transects, which covered all habitat types on the
  1,737 acres were surveyed four times. A total of 82 species were recorded for the
  area. The habitat types were categorized as bottomland hardwoods, agriculture, grasslands,
  wetlands and scrub/shrub. Ten species of concern were found on the area including
  the Yellow-billed Cuckoo, Black-billed Cuckoo, Wood Thrush, Prothonotary Warbler,
  Hooded Warbler, Dickcissel, Grasshopper Sparrow, Bobolink and Yellow-breasted Chat.\",\n\t\"owner_org\":
